import React from 'react';
import {useHistory} from 'react-router-dom'; 
function Welcome()
{

  const history=useHistory();  

    function newUser()
{
    history.push('/newuser');
}
function login()
{
    history.push('/login');
}
    return(<div>
        <h1>Welcome Page</h1>
        <br/>    
      {/* <button type="submit"><Link to="/newuser">Register</Link></button>      */}
      <button type="submit" onClick={newUser}>Register</button>
      <br/>
      <br/>    
      {/* <button type="submit"><Link to="/newuser">Register</Link></button>      */}
      <button type="submit" onClick={login}>Register</button>
      <br/>
        </div>)
}
export default Welcome;
